import sampleImage from ".";

const ImagesSection = () => {
  return (
    <section className="bg-orange-100 p-10 grid grid-cols-2 gap-4">
      <div>
        <img src={sampleImage} alt="Real estate" className="w-full h-auto" />
        <h3>Uncover valuable resources</h3>
        <p>
          We collect data about who throws what to motivate and reward waste
          sorting efforts.
        </p>
      </div>
      <div>
        <img
          src={sampleImage}
          alt="Waste Management"
          className="w-full h-auto"
        />
        <h3>Motivate better sorting</h3>
        <p>
          Get a full overview of infrastructure, resources, and user data, and
          use insights to reward and motivate sustainable behavior.
        </p>
      </div>
    </section>
  );
};

export default ImagesSection;
